(636, 4, NULL, NULL, '<p>Мы&nbsp;основали компанию 26 ноября 2008 года. Вот основные вехи развития нашей фирмы:</p>\r\n<ul>\r\n<li>2008&nbsp;&mdash; дата основания.</li>\r\n<li>2010&nbsp;&mdash; первые 100 клиентов. Значительное пополнение нашего автопарка.&nbsp;</li>\r\n<li>2015&nbsp;&mdash; первые 1000 клиентов. Наш автопарк насчитывает ровно 100 машин.&nbsp;</li>\r\n<li>2018&nbsp;&mdash; десятилетний юбилей компании.</li>\r\n</ul>', NULL, NULL, NULL),
