(642, 240, NULL, NULL, '<p>Скидка на аренду спецтехники 50%!</p>', NULL, NULL, NULL),
(640, 240, NULL, NULL, '<p>Теперь у нас есть автокраны.</p>', NULL, NULL, NULL),
(641, 240, NULL, NULL, '<p>Дарим скидку в 14% на аренду любой спецтехники.</p>', NULL, NULL, NULL),
(639, 240, NULL, NULL, '<p>Важные моменты при выборе строительной техники. Рассказываем все детали.</p>', NULL, NULL, NULL),
(639, 243, 1550320860, NULL, NULL, NULL, NULL, NULL),
(640, 243, 1558183260, NULL, NULL, NULL, NULL, NULL),
(641, 243, 1551444060, NULL, NULL, NULL, NULL, NULL),
(642, 243, 1546605720, NULL, NULL, NULL, NULL, NULL),
(639, 4, NULL, NULL, '<p>От выбора самосвала зависит очень многое, например, качество и скорость выполнения строительных работ на участке.&nbsp;<br /><br />Этот материал подскажет вам, по каким признакам стоит выбирать самосвал в аренду.<br /><br />Если у вас остались вопросы, то мы с радостью вам поможем.&nbsp;</p>', NULL, NULL, NULL),
(640, 4, NULL, NULL, '<p>В нашем автопарке появились автокраны. С их помощью вы сможете выполнять больший спект строительных работ.&nbsp;<br /><br />На данный момент для аренды доступно 5 машин. Первому клиенту, позвонившему нам, мы снизим стоимость на аренду автокрана на 2000 рублей.<br /><br />Звоните скорее, если вы хотите арендовать автокран по выгодной стоимости.&nbsp;</p>', NULL, NULL, NULL),
(641, 4, NULL, NULL, '<p><span>Весна&nbsp;<span>&mdash;<span>&nbsp;</span></span> самое время для начала нового строительства. Всем клиентам, обратившимся к нам с 1 марта по 30 мая, мы дарим скидку 14% на аренду всей нашей спецтехники.&nbsp;<br /><br />Вся спецтехника в нашем автопарке предоставляется с оператором. Скидку мы предоставляем при условии аренды спецтехники на срок от 1 дня.<br /><br />Поспешите, количество машин в автопарке ограничено.&nbsp;</span></p>', NULL, NULL, NULL),
(642, 4, NULL, NULL, '<p>Прекрасное предложение для наших постоянных клиентов. Если вы планируете арендовать спецтехнику на срок от 5 месяцев, то мы предоставим вам скидку 50% со второго месяца аренды.</p>\r\n<p>Взять спецтехнику в аренду с внушительной скидкой можно до 20 ноября 2020 года.</p>\r\n<p>Спешите, количество машин в автопарке ограничено!</p>', NULL, NULL, NULL),
