(643, 5, NULL, 'Каталог спецтехники для аренды в СПб недорого от компании Стройтех - тут вы найдете полный ассортимент нашего автопарка.', NULL, NULL, NULL, NULL),
(643, 267, NULL, NULL, '<p>Аренда спецтехники&nbsp;&mdash; это намного выгоднее, чем ее&nbsp;покупка, если проведение строительных работ на&nbsp;предприятии не&nbsp;осуществляется на&nbsp;постоянной основе.<br /> В&nbsp;этом разделе вы&nbsp;сможете ознакомиться со&nbsp;спецтехникой, которую предлагает в&nbsp;аренду наша компания, а&nbsp;также узнать цены.<br /> Преимущества нашей спецтехники:</p>\r\n<ul>\r\n<li>В&nbsp;нашем автопарке спецтехника для аренды не&nbsp;старше 5 лет.</li>\r\n<li>Мы&nbsp;постоянно отправляем нашу спецтехнику на&nbsp;ТО&nbsp;и&nbsp;своевременно устраняем неполадки.</li>\r\n<li>Все вышеперечисленное мы&nbsp;можем подтвердить документально.</li>\r\n</ul>\r\n<p>Позвоните нам по&nbsp;телефону 8-888-88-88, чтобы узнать стоимость аренды спецтехники в&nbsp;нашей компании. Также мы&nbsp;поможем вам подобрать спецтехнику конкретно для ваших нужд.</p>', NULL, NULL, NULL),
(644, 2, NULL, 'Аренда бульдозеров в СПб - спецтехника от компании Стройтех', NULL, NULL, NULL, NULL),
(644, 6, NULL, 'аренда бульдозера спб, аренда бульдозера недорого', NULL, NULL, NULL, NULL),
(644, 5, NULL, 'Аренда бульдозера в СПб недорого, почасовая оплата, условия аренды читайте на сайте нашей компании.', NULL, NULL, NULL, NULL),
(644, 267, NULL, NULL, '<p>Аренда бульдозера значительно сэкономит ваши средства. В&nbsp;среднем, покупка бульдозера обойдется вам в&nbsp;8&nbsp;миллионов рублей. Согласитесь, если строительной работы не&nbsp;производятся вами на&nbsp;постоянной основе, то&nbsp;такие большие траты довольно нерациональны.</p>\r\n<p>В&nbsp;этом разделе вы&nbsp;найдете бульдозеры из&nbsp;нашего автопарка.</p>', NULL, NULL, NULL),
(645, 2, NULL, 'Аренда самосвалов в СПб недорого - спецтехника Стройтех', NULL, NULL, NULL, NULL),
(645, 6, NULL, 'аренда самосвала спб недорого, аренда самосвала спб', NULL, NULL, NULL, NULL),
(645, 5, NULL, 'Аренду самосвала в СПБ недорого посуточно предоставляет компания СтройТех, условия аренды читайте на сайте.', NULL, NULL, NULL, NULL),
(645, 267, NULL, NULL, '<p>Аренда самосвала с&nbsp;оператором станет отличной возможностью сэкономить денежные средства без потери качества.</p>\r\n<p>В&nbsp;каких случаях вам может потребоваться самосвал:</p>\r\n<ul>\r\n<li>Для перевозки сухих продуктов.</li>\r\n<li>Для вывоза грунта.</li>\r\n</ul>\r\n<p>В&nbsp;этом разделе вы&nbsp;найдете полную информацию о&nbsp;самосвалах из&nbsp;нашего автопарка.</p>', NULL, NULL, NULL),
(646, 2, NULL, 'Аренда автокранов в СПб недорого - спецтехника Стройтех', NULL, NULL, NULL, NULL),
(646, 6, NULL, 'аренда автокрана спб, аренда автокрана недорого', NULL, NULL, NULL, NULL),
(646, 5, NULL, 'Аренда автокрана в СПб недорого - в компании СтройТех мы представляем стройтехнику в аренду посуточно, условия читайте на сайте.', NULL, NULL, NULL, NULL),
(646, 267, NULL, NULL, '<p>При совершении масштабных строительно-монтажных работ часто возникает нужда в перемещении многотонных грузов. В таких случаях аренда автокрана с оператором значительно сэкономит ваши силы и время.</p>\r\n<p>В этом разделе вы можете ознакомиться с нашим автопарком.</p>', NULL, NULL, NULL),
