(649, 2, NULL, 'Аренда экскаваторов в СПб недорого - спецтехника СтройТех', NULL, NULL, NULL, NULL),
(649, 6, NULL, 'аренда экскаватора спб, аренда экскаватора спб недорого', NULL, NULL, NULL, NULL),
(649, 5, NULL, 'Аренда экскаватора в СПб недорого, с оператором, оплата почасовая - все это возможно в компании СтройТех.', NULL, NULL, NULL, NULL),
(649, 267, NULL, NULL, '<p>Аренда экскаватора с&nbsp;оператором&nbsp;&mdash; отличное решение. С такой техникой вы&nbsp;значительно ускорите процесс строительства.<br /> В&nbsp;нашем автопарке представлены только лучшие экскаваторы на&nbsp;рынке. Выбирайте тот, который подходит вам по&nbsp;техническим характеристикам. Мы&nbsp;ответим на&nbsp;все ваши вопросы.</p>', NULL, NULL, NULL),
(650, 2, NULL, 'Аренда Асфальтоукладчика в СПб недорого - спецтехника Стройтех', NULL, NULL, NULL, NULL),
(650, 6, NULL, 'аренда асфальтоукладчика спб, аренда асфальтоукладчика недорого', NULL, NULL, NULL, NULL),
(650, 5, NULL, 'Аренда асфальтоукладчика в СПб недорого - в компании Стройтех техника предоставляется в аренду с оператором.', NULL, NULL, NULL, NULL),
(650, 267, NULL, NULL, '<p>Если вам требуется строить дороги или укладывать асфальт, то&nbsp;без помощи асфальтоукладчика вам не&nbsp;обойтись.</p>\r\n<p>В&nbsp;нашей компании вы&nbsp;можете арендовать асфальтоукладчики следующих разновидностей:</p>\r\n<ul>\r\n<li>Тротуарный асфальтоукладчик.</li>\r\n<li>Гусеничный автоукладчик.</li>\r\n</ul>\r\n<p>В&nbsp;этом разделе вы&nbsp;найдете информацию обо всех асфальтоукладчиках из&nbsp;нашего автопарка.</p>', NULL, NULL, NULL),
(651, 2, NULL, 'Аренда вездехода в СПБ недорого - спецтехника Стройтех', NULL, NULL, NULL, NULL),
