(651, 5, NULL, 'Аренда вездехода в СПБ, недорого, с оператором, обращайтесь в компанию Стройтех.', NULL, NULL, NULL, NULL),
(651, 267, NULL, NULL, '<p>Вездеход пригодится в ситуации, когда ваша стройплощадка находится в труднодоступном месте. Также он поможет в тех случаях, когда необходим прицеп.</p>\r\n<p>В этом разделе вы найдете информацию обо всех вездеходах, что есть в нашем автопарке.</p>', NULL, NULL, NULL),
