(624, 431, NULL, NULL, '<div class=\"direction_block_title\">аренда</div>\r\n<div class=\"direction_block_subtitle\">строительной</div>\r\n<div class=\"direction_block_subtitle\">техники</div>', NULL, NULL, NULL),
(624, 430, NULL, NULL, NULL, NULL, 3, NULL),
(624, 424, NULL, 'Наши услуги', NULL, NULL, NULL, NULL),
(624, 425, NULL, NULL, '<p>Аренда строительной техники в нашей компании &mdash; это всегда внимательное и вежливое отношение к заказчику, конкурентные цены и отличная надежная рабочая машина!</p>', NULL, NULL, NULL),
(624, 426, NULL, NULL, '<p>Мы мастера своего дела и относимся к своей работе со всей ответственностью. Будь это своевременное предоставление строительных машин на объект или оформление первичных бухгалтерских документов, наши сотрудники <span>удивят вас скоростью своей работы и высоким уровнем сервиса</span></p>', NULL, NULL, NULL),
(624, 427, NULL, NULL, '<ul class=\"advantages_block\">\r\n<li class=\"pag_nav_1 simple-text-14\">\r\n<div class=\"advantages_block-icon\"></div>\r\n<p class=\"p-head\">Собственный парк спецтехники</p>\r\n</li>\r\n<li class=\"pag_nav_1 simple-text-14\">\r\n<div class=\"advantages_block-icon\"></div>\r\n<p class=\"p-head\">Оперативная поставка спецтехники</p>\r\n</li>\r\n<li class=\"pag_nav_2 simple-text-14\">\r\n<div class=\"advantages_block-icon\"></div>\r\n<p class=\"p-head\">Гарантия выполнения работ<img id=\"__mce_tmp\" alt=\"\" /></p>\r\n</li>\r\n</ul>', NULL, NULL, NULL),
(624, 428, NULL, 'Популярные модели', NULL, NULL, NULL, NULL),
(624, 432, NULL, NULL, NULL, NULL, 9, NULL),
(624, 433, NULL, NULL, NULL, NULL, 4, NULL),
(624, 434, NULL, NULL, '<p>Наша компания предоставляет спецтехнику в&nbsp;аренду. Мы&nbsp;зарекомендовали себя как надежный партнер. Обратившись к&nbsp;нам, вы&nbsp;получите только новую технику, а&nbsp;еще профессионального оператора. Он&nbsp;выполнит все требуемые от&nbsp;него задачи.</p>', NULL, NULL, NULL),
