ь, если строительной работы не&nbsp;производятся вами на&nbsp;постоянной основе, то&nbsp;такие большие траты довольно нерациональны.</p>\r\n<p>В&nbsp;этом разделе вы&nbsp;найдете бульдозеры из&nbsp;нашего автопарка.</p>\";s:14:\"category_image\";s:0:\"\";s:11:\"rate_voters\";s:0:\"\";s:8:\"rate_sum\";s:0:\"\";s:8:\"lockuser\";s:0:\"\";s:12:\"index_source\";s:0:\"\";s:11:\"index_state\";s:0:\"\";s:12:\"index_choose\";s:1:\"0\";s:11:\"index_level\";s:0:\"\";s:18:\"additional_content\";s:0:\"\";}}}', 182, 1),
